import React, { useState } from 'react';
import './App.css'; 

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const handleLogin = () => {
    setIsLoggedIn(true);
  };

  const handleLogout = () => {
    setIsLoggedIn(false);
  };

  return (
    <div className="App">
      <NavigationBar isLoggedIn={isLoggedIn} onLogin={handleLogin} onLogout={handleLogout} />

      <div className="content">
        <h1>Welcome to My React App!</h1>
        <p>This is the main content of your page.</p>
      </div>

      <Footer />
    </div>
  );
}

export default App;
